import React, {Component} from "react";
import "./docs.css";

class Docs extends Component{
    constructor(props){
        super(props)

        this.table_names = [
            "",
            "",
            "",
            "",
            "",
            "",
            ""
        ]
    }

    render(){
        return(
            <div className="docs">
                <ul className="table_list">
                    {this.table_names.map((item, index) => {
                        return <li key={index}>
                            Hello
                        </li>
                    })}
                </ul>
            </div>
        )
    }
}

export default Docs
